    true,nt"url": null,nt"notes": "The National Postsecondary Student Aid Study,
    2007-08 (NPSAS:08), is a study that is part of the National Postsecondary Student
    Aid Study (NPSAS) program. NPSAS:08 [http://nces.ed.gov/surveys/npsas/about.asp]is
    a cross-sectional survey that is designed to compile a comprehensive research dataset,
    based on student-level records, on financial aid provided by the federal government,
    the states, postsecondary institutions, employers, and private agencies, along with
    student demographic and enrollment data. The study was conducted using multiple
    sources, including institutional records, government databases, and student interviews.
    NPSAS:08 contains the data on a sample of 114,000 undergraduate students and 14,000
    graduate students. These students were enrolled between July 1, 2007 and June 30,
    2008 in about 1,730 postsecondary institutions. The data are representative of all
    undergraduate and graduate students enrolled in postsecondary institutions in the
    50 United States, the District of Columbia, and Puerto Rico that were eligible to
    participate in the federal financial aid programs in Title IV of the Higher Education
    Act. Statistics produced from the NPSAS:08 provide reliable national estimates of
    characteristics related to financial aid for postsecondary students.",nt"license_title":
